import React from "react";
import { Card } from "../../Card.styled";
import { ImageCard } from "../../ImageCard.styled";
const Grid2 = ({ content, styles }) => {
  const renderedContents = content.trendingAuctions.map((element) => {
    return (
      <Card mg={"2rem 0rem"} height={"14rem"} bd={"1px solid red"}>
        <Card dp={"inline"} mg={"0.5rem"}>
          {element.tag}.
        </Card>
        <Card
          cl={styles.colors.textAlt}
          fs={"0.6rem"}
          dp={"inline-block"}
          mg={"0.5rem"}
        >
          DAY {element.day}
        </Card>
        <Card
          cl={styles.colors.textAlt}
          fs={"0.6rem"}
          dp={"inline-block"}
          mg={"0.5rem"}
          float={"right"}
        >
          {element.user}
        </Card>
        <ImageCard
          mg={"0rem 1rem"}
          dp={"inline"}
          // bg={"red"}
          src={element.image}
          height={"10rem"}
          width={"9rem"}
        />
      </Card>
    );
  });
  return (
    <>
      <Card bd={"1px solid red"}>
        <Card dp={"grid"} gridC={"27% 27% 27%"} gridjc={"space-between"}>
          {renderedContents}
        </Card>
      </Card>
    </>
  );
};

export default Grid2;
